    false,nt"url": null,nt"notes": "This narrative report for Burford Lake
    Wildlife Management Area outlines Refuge accomplishments from May through August
    of 1956. The report begins by summarizing the weather conditions and water conditions
    during this period. Wildlife- including migratory birds, upland game birds, big
    game animals, furbearers, predators, raptors, and fish- is also covered. The Refuge
    development and maintenance section discusses physical developments and wildfires.
    Resource management is outlined; topics include grazing, haying, and timber removal.
    The public relations section of the report describes recreational uses, Refuge visitors,
    and violations. Items of interest are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
